import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';

import Card from '../Components/Card'

//Este componente debera ser estilado como "dark" o "light" dependiendo del theme del Context

const Home = () => {

  const [dentists, setDentists] = useState([]);

  // Simulando la llamada a la API para obtener los datos de los dentistas
  useEffect(() => {
    // Aquí deberías realizar la llamada real a la API
    const fetchData = async () => {
      try {
        // Lógica para obtener datos de la API
        const response = await fetch('URL_DE_TU_API');
        const data = await response.json();
        setDentists(data);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };
    fetchData();
  }, []);

  return (
    <main className="" >
      <h1>Home</h1>
      <div className='card-grid'>
        {/* Aqui deberias renderizar las cards */
        dentists.map((dentist) => (
          <Link key={dentist.id} to={`/dentist/${dentist.id}`}>
            <Card dentist={dentist} /> {/* Utilizar el componente de Card */}
          </Link>
        ))
        }
      </div>
    </main>
  )
}

export default Home
